package puppyWalk.dog.vo;

public class Dog {
	
	private int memberNo;
	private int dogNo;
	private String dogName;
	private String dogGender;
	private int dogAge;
	private String dogComment;
	private String dogAlert;
	private String dogVar;
	
	
	public Dog() {
		// TODO Auto-generated constructor stub
	}

	 

	public String getDogVar() {
		return dogVar;
	}



	public void setDogVar(String dogVar) {
		this.dogVar = dogVar;
	}



	public int getMemberNo() {
		return memberNo;
	}


	public void setMemberNo(int memberNo) {
		this.memberNo = memberNo;
	}


	public int getDogNo() {
		return dogNo;
	}


	public void setDogNo(int dogNo) {
		this.dogNo = dogNo;
	}


	public String getDogName() {
		return dogName;
	}


	public void setDogName(String dogName) {
		this.dogName = dogName;
	}


	public String getDogGender() {
		return dogGender;
	}


	public void setDogGender(String dogGender) {
		this.dogGender = dogGender;
	}


	public int getDogAge() {
		return dogAge;
	}


	public void setDogAge(int dogAge) {
		this.dogAge = dogAge;
	}


	public String getDogComment() {
		return dogComment;
	}


	public void setDogComment(String dogComment) {
		this.dogComment = dogComment;
	}


	public String getDogAlert() {
		return dogAlert;
	}


	public void setDogAlert(String dogAlert) {
		this.dogAlert = dogAlert;
	}
	
	

}
